import React from 'react';

function Player({ player }) {
  return (
    <div>
      <b>{player.name}</b> <span>({player.team})</span>
    </div>
  );
}

function PlayerList({players}) {
  

  return (
    <div>
      {players.map(player => (
        <Player player={player} key={player.id} />
      ))}
    </div>
  );
}

export default PlayerList;
